import React from 'react';
import './Dashboard.css'; // Ensure this file exists and is correctly linked

const Dashboard = () => {
  return (
    <div className="dashboard">
      <h1 className="dashboard-title">OVERVIEW</h1>
      
      <div className="dashboard-section priority-tasks">
        <h2>PRIORITY TASKS</h2>
        {/* This would be replaced with the actual list of tasks */}
      </div>
      
      <div className="dashboard-section task-analytics">
        <h2>TASK ANALYTICS</h2>
        {/* This would be replaced with the actual task analytics */}
      </div>
      
      <div className="dashboard-section calendar">
        <h2>CALENDAR</h2>
        {/* This would be replaced with the actual calendar */}
      </div>

      <div className="report-button-container">
        <button className="report-button">View reports here</button>
      </div>
    </div>
  );
};

export default Dashboard;
